import React from 'react';
import { AppBar, Toolbar, Button, IconButton } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { useNavigate } from 'react-router-dom';

const MyAppBar = () => {
  const navigate = useNavigate();
  
  const navigateHome=()=>{
        navigate("/home");
    }

  const navigateAbout = () => {
        navigate("/about");
  };

  const handleLogout = () => {
       navigate("/");
  };

  return (
    <AppBar
    position="static"
    sx={{
      backgroundColor: '#3f51b5',
      width: '100%', // Full width of the viewport
      height: '80px', // Adjust height to make it taller
      margin: 0,     // No gaps around the AppBar
      padding: '0 16px', // Optional padding for inner content
      display: 'flex', // Flexbox for content alignment
      justifyContent: 'center', // Center content vertically
    }}
  >
    <Toolbar
      sx={{
        display: 'flex',
        justifyContent: 'space-between', // Spread items across the AppBar
        width: '1000%',
      }}
    >
        <IconButton
          size="large"
          edge="start"
          color="inherit"
          aria-label="menu"
          sx={{ mr: 2 }}
        >
          <MenuIcon />
        </IconButton>
        <Button color="inherit" onClick={navigateHome}>Home</Button>
        <Button color="inherit" onClick={navigateAbout}>About</Button>
        <Button color="inherit" onClick={handleLogout}>Logout</Button>
      </Toolbar>
    </AppBar>
  );
};

export default MyAppBar;
